import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about">
      <h2 className="about__title">Acerca de Nosotros</h2>
      <p className="about__text">Somos el mejor sitio de e-commerce.</p>
    </div>
  );
}

export default About;
